	子弹属性.子弹种类 = "近战子弹";

	自机 = _root.获得父节点(this,2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 15 + 自机.刀属性.power * 1.5;
	if(自机.等级 < 12){
		子弹属性.子弹威力 = Math.floor(子弹属性.子弹威力 * (自机.等级 + 5)/20)
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;

	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}
